import Admin from '../containers/admin/admim';
import Login from '../containers/login/login';
import { Navigate } from "react-router-dom"

const Routes = [
  {
    path: "/login",
    element: <Login />,
  },
  {
    path: "/admin",
    element: <Admin />,
    children: [
      {
        path: "/home",
        element: <Home />,
      },
      {
        path: "/category",
        element: <Home />,
      }, {
        path: "/product",
        element: <Home />,
      },
      {
        path: "/role",
        element: <Home />,
      },
      {
        path: "/user",
        element: <Home />,
      },
      {
        path: "/charts/bar",
        element: <Home />,
      },
      {
        path: "/charts/line",
        element: <Home />,
      },
      {
        path: "/charts/pie",
        element: <Home />,
      },
    ]
  },
  {
    path: "/",
    element: <Navigate to="/login" />
  },
]

export default Routes
